import React from 'react';
import './CartSlider.scss'; 

export const CartSlider = () => {

  return (
    <div className="CartSlider">
      <div className="CartSlider-Container">
        <p className="CartSlider-Title">Title</p>
        <div className="CartSlider-Buttons">
          <button className="CartSlider-ButtonsPrev button_cart">
            <img src="../img/prev.svg" alt="Prev" className="image"/>
          </button>
          <button className="CartSlider-ButtonsNext button_cart">Next</button>
        </div>
      </div>
      <div className="CartSlider-Content">
       {}
      </div>
    </div>

  )
}
